@import url('https://fonts.googleapis.com/css2?family=Raleway:wght@400;500;700;900&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Cardo:ital@1&display=swap');
/* font-family: 'Raleway', sans-serif; */
/* font-family: 'Cardo', serif; */

.raleway700-13-white{
	font-family: 'Raleway', sans-serif;
	font-weight: 700;
	font-size: 13px;
	text-transform: uppercase;
	color: white;
}
.raleway900-64-white{
	font-family: 'Raleway', sans-serif;
	font-weight: 900;
	font-size: 64px;
	text-transform: uppercase;
	color: white;
	text-align: center;
	@media screen and (min-width: 320px) and (max-width: 767px){
		font-size: 36px;
	}
}
.raleway400-24-white{
	font-family: 'Raleway', sans-serif;
	font-weight: 400;
	font-size: 24px;
	color: white;
	text-align: center;
	@media screen and (min-width: 320px) and (max-width: 767px){
		font-size: 14px;
	}
}
.raleway900-24-white{
	font-family: 'Raleway', sans-serif;
	font-weight: 900;
	font-size: 24px;
	text-transform: uppercase;
	color: white;
	text-align: center;
	text-decoration: none;
	@media screen and (min-width: 320px) and (max-width: 479px){
		font-size: 15px;
	}
}
.raleway900-24-black{
	font-family: 'Raleway', sans-serif;
	font-weight: 900;
	font-size: 24px;
	color: black;
	text-align: center;
